(function(a,b){a.libChecker=new function(){var c=this;this.exist=function(d){return c.libs[d].exist()};this.version={getCurrent:function(d){return c.libs[d].version.getCurrent()},equal:function(e,d){return c.libs[e].version.equal(d)},lessThan:function(e,d){return c.libs[e].version.lessThan(d)},greaterThan:function(e,d){return c.libs[e].version.greaterThan(d)}};this.libs={};this.helpers={compare:function(j,h){if(typeof j+typeof h!="stringstring"){return false}var f=j.split("."),e=h.split("."),g=0,d=Math.max(f.length,e.length);for(;g<d;g++){if((f[g]&&!e[g]&&parseInt(f[g])>0)||(parseInt(f[g])>parseInt(e[g]))){return 1}else{if((e[g]&&!f[g]&&parseInt(e[g])>0)||(parseInt(f[g])<parseInt(e[g]))){return -1}}}return 0},isValid:function(f,e,d){if(!f.exist()||e===b||e===null||e===""){return false}return true},equal:function(g,d){var f=g.version.getCurrent();var e=a.libChecker.helpers;if(!e.isValid(g,f,d)){return b}return e.compare(f,d)===0},lessThan:function(g,d){var f=g.version.getCurrent();var e=a.libChecker.helpers;if(!e.isValid(g,f,d)){return b}return e.compare(f,d)===-1},greaterThan:function(g,d){var f=g.version.getCurrent();var e=a.libChecker.helpers;if(!e.isValid(g,f,d)){return b}return e.compare(f,d)===1}}}})(window);